import React from "react";
import { useSelector } from "react-redux";

import { Modal } from "antd";

const ReturnModal = () => {
  const detailRecipe = useSelector((state) => state.detailRecipe);

  console.log("detailRecipe: ", detailRecipe.detailRecipe);
  return (
    <Modal visible={detailRecipe.status} footer={null}>
      <div>{detailRecipe.detailRecipe?.publisher}</div>
    </Modal>
  );
};

export default ReturnModal;
